import React,{useEffect, useState} from 'react'
import { Link} from 'react-router-dom'
import httpClient from '../../httpClient'

import test from '../../images/test.jpg'


export default function Header() {

  const [profileData,setProfileData] = useState({
    username:"",
    image:"",
    rank:"",
    followers:"",
    following:"",

  })

  useEffect(() => 
    async () => {
    try {
      const resp = await httpClient.get("/@me")
      setProfileData(prevState => ({
        ...prevState,
        username: resp.data.username
      }))
    }
    catch(e) {
      console.log("Not authenticated")
    }
  },[])
  return (
    <header className='profile-header'>
        <img className = 'profile-picture' src = {test} alt = 'profile picture'/>
        <section className='left-section'>
            <div className='top'>
                <p className='username'>{profileData.username}</p>
                <Link to={'/account/edit'}><button className='edit-profile-button'>Edit Profile</button></Link>
            </div>
            <div className='bottom'>
                <p className='number-posts'>{profileData.rank}</p>
                <p className='followers'>{profileData.followers}</p>
                <p className='following'>{profileData.following}</p>
            </div>
        </section>
    </header>
  )
}
